import { borderRadius } from "@mui/system";
import React from "react";

const Status = (status) => {
    if (status.status == true) {
        return <div style={{ backgroundColor: '#6eeb94', borderRadius: 5, width: 80, height: 30 }}>Approve</div>
    } else {
        return <div style={{ backgroundColor: '#ff2121', borderRadius: 5}}>Reject</div>
    }
}

export default Status
